export enum ConnectionStatus {
  INVITED = "invited",
  REQUESTED = "requested",
  RESPONDED = "responded",
  COMPLETE = "complete",
  ACTIVE = "active",
}

export enum RoutingStatus {
  INVITED,
  REQUESTED,
  RESPONDED,
  COMPLETE,
  ACTIVE,
}

export enum AcceptType {
    AUTO
}

export enum InvitationMode{
    ONCE
}
